var filter_filter = jquery('#filter');
var btnBrandsViewAll = jquery('#filter-brands-view-all');
var filterBrandsInput = jquery('#filter-brands-input');
var brandsList = jquery('#filter-brands-list');
var filterBrandsItems = brandsList.find('.input-checkbox__label');
var filterTitleToggle = jquery('.filter-title-toggle-js');
var btnFilterReset = jquery('#filter-reset');
var applyBlock = jquery('#filter-apply-block-js');
var filterContent = jquery('#filter-content');
var filter_startX;
jquery('.filter-categories__list a:has(svg)').click(function (e) {
  if (jquery(this).find('+ ul > li > a').hasClass('current-category')) return;
  e.preventDefault();
  e.stopPropagation();
  var linkSvg = jquery(this).find('svg');
  if (linkSvg.hasClass('icon-right')) {
    linkSvg.removeClass('icon-right').addClass('icon-left');
    linkSvg.find('use').attr('href', 'images/icons/icons.svg#chevron-left-small');
  } else {
    linkSvg.removeClass('icon-left').addClass('icon-right');
    linkSvg.find('use').attr('href', 'images/icons/icons.svg#chevron-right-small');
  }
  if (jquery(this).hasClass('active')) {
    jquery(this).removeClass('active');
    jquery(this).next().slideUp(300);
  } else {
    jquery(this).addClass('active');
    jquery(this).next().slideDown(300);
  }
});

// открытие формы
btnOpenFilter.click(openFilter);

// закрытие формы
btnCloseFilter.click(closeFilter);

// закрытие по touch событию вправо
// filter.on('touchstart', getStartX);
//
// filter.on('touchmove', closingBySwipe);

// раскрыть/скрыть бренды
btnBrandsViewAll.click(brandsViewAll);

// поиск по брендам
filterBrandsInput.on('input', filterBrandsSearch);

// раскрыть/скрыть блок с фильтром по клику на title
filterTitleToggle.click(filterBlockToggle);

// сброс формы
btnFilterReset.click(filterReset);

// отобразить кнопку "применить", если в форме что-то изменилось
if (isDevice()) {
  filter_filter.find('input').not(filterBrandsInput).on('change input keypress', displayApplyBtn);
}
function openFilter() {
  filter_filter.addClass('active');
  jquery('body').addClass('overflow-hidden');
}
function closeFilter() {
  filter_filter.removeClass('active');
  jquery('body').removeClass('overflow-hidden');
}
function filter_getStartX(e) {
  filter_startX = e.originalEvent.touches[0].pageX;
}
function filter_closingBySwipe(e) {
  var currentX = e.originalEvent.touches[0].pageX;
  var distance = currentX - filter_startX;
  if (distance > 100 && !$(e.target).closest('.slider').length) {
    filter_filter.removeClass('active');
    $('body').removeClass('overflow-hidden');
  }
}
function brandsViewAll() {
  var textViewAll = jquery(this).data('text-view-all');
  var textHide = jquery(this).data('text-hide');
  jquery(this).toggleClass('active');
  brandsList.toggleClass('active');
  if (jquery(this).hasClass('active')) {
    jquery(this).text(textHide);
  } else {
    jquery(this).text(textViewAll);
  }
}
function filterBrandsSearch() {
  var searchText = jquery(this).val().toLowerCase();

  // Перебираем каждый элемент
  filterBrandsItems.each(function () {
    var brandName = jquery(this).find('.input-checkbox__value').text().toLowerCase();
    // Проверяем, содержится ли введенный текст в названии бренда
    if (brandName.indexOf(searchText) === -1) {
      jquery(this).hide();
    } else {
      jquery(this).show();
    }
  });

  // скрыть кнопку "посмотреть все", если есть скролл у блока с брендами
  if (brandsList[0].scrollHeight > brandsList.innerHeight()) {
    btnBrandsViewAll.show();
  } else {
    btnBrandsViewAll.hide();
  }
}
function filterBlockToggle() {
  jquery(this).toggleClass('active');
}
function filterReset() {
  filter_filter[0].reset();
  filter_filter.find('.min-value, .max-value').each(function () {
    jquery(this).trigger('change');
  });
  if (isDevice()) {
    hideApplyBtn();
  }
}
function displayApplyBtn() {
  applyBlock.show();
  filterContent.addClass('padding-for-apply');
}
function hideApplyBtn() {
  applyBlock.hide();
  filterContent.removeClass('padding-for-apply');
}
