/* Добавление товара в корзину, уведомление + отображение счетчиков */
var notification = jquery('#notification');
var timerNotification = null;
var counterBasketItem = jquery('.counter-basket-js');
var buy_buttonToTop = jquery('#button-to-top');
jquery(document).on('click', '.buy-js', function () {
  if (isMobile) {
    buy_buttonToTop.addClass('notification-is-active');
  }
  notification.fadeIn(300);
  if (timerNotification !== null) clearTimeout(timerNotification);
  timerNotification = setTimeout(function () {
    notification.fadeOut(300);
    if (isMobile) {
      buy_buttonToTop.removeClass('notification-is-active');
    }
  }, 3000);
  var currentBuyCount = jquery(this).attr('data-buy-count');
  currentBuyCount++;
  jquery(this).attr('data-buy-count', currentBuyCount);
  displayCounter();
});
function displayCounter() {
  var totalBuyCount = 0;
  jquery('[data-buy-count]').each(function () {
    totalBuyCount += +jquery(this).attr('data-buy-count');
  });
  if (totalBuyCount === 0) {
    counterBasketItem.text('');
  }
  if (totalBuyCount > 0) {
    counterBasketItem.text(totalBuyCount);
  }
}

// закрытие уведомление по клику на крестик
var btnCloseNotification = jquery('#notification-close');
btnCloseNotification.click(function () {
  clearTimeout(timerNotification);
  notification.fadeOut(300);
  buy_buttonToTop.removeClass('notification-is-active');
});
/* end Добавление товара в корзину, уведомление + отображение счетчиков */

/* amount */
var amountMinus = jquery('.amount-minus-js');
var amountInput = jquery('.amount-input-js');
var amountPlus = jquery('.amount-plus-js');
amountMinus.click(function () {
  var input = jquery(this).next();
  var dataAddCount = 1;
  if (jquery(this).closest('.amount').data('add-count')) {
    dataAddCount = jquery(this).closest('.amount').data('add-count');
  }
  input.val(+input.val() - dataAddCount);
  if (input.val() < 1) {
    input.val(1);
    jquery(this).parent().siblings('.buy-js').attr('data-buy-count', 1);
    return;
  }
  jquery(this).parent().siblings('.buy-js').attr('data-buy-count', input.val());
  displayCounter();
});
amountPlus.click(function () {
  var input = jquery(this).prev();
  var dataAddCount = 1;
  var dataMax = jquery(this).closest('.amount').data('max');
  if (jquery(this).closest('.amount').data('add-count')) {
    dataAddCount = jquery(this).closest('.amount').data('add-count');
  }
  input.val(+input.val() + dataAddCount);
  jquery(this).parent().siblings('.buy-js').attr('data-buy-count', input.val());
  if (input.val() > dataMax) {
    input.val(dataMax);
    jquery(this).parent().siblings('.buy-js').attr('data-buy-count', dataMax);
    return;
  }
  displayCounter();
});
amountInput.on('input', function () {
  if (jquery(this).val() < 1) jquery(this).val(1);
  if (jquery(this).val() > 100) jquery(this).val(100);
  jquery(this).parent().siblings('.buy-js').attr('data-buy-count', jquery(this).val());
  displayCounter();
});

/* end amount */
